$pc: em($containerWidth); // ПК, ноутбуки, некоторые таблетки в горизонтальном положении\r\n$tablet: em(991.98); // Таблетки, некоторые телефоны в горизонтальном положении\r\n$mobile: em(767.98); // Телефоны L\r\n$mobileSmall: em(479.98); // Телефоны S\r\n\r\n// Адаптируемый тип:\r\n// 1 = отзывчивость (контейнер не имеет точек останова),\r\n// 2 = по точке разрыва (контейнер меняет ширину на точку разрыва)\r\n$responsiveType: 1;\r\n\r\n// \r\n// \r\n\r\n//Reset\r\n@import \"base/null\"; \r\n\r\n//Fonts  закинуть в папку fonts файлы ttf otf \r\n//@import 'fonts/fonts';  \r\n\r\n//Fontawesome + поверить ссылку в Head.html\r\n@import 'libs/fontAwesome/fontawesome'; \r\n\r\n// GLOBAL \r\n// сайт загружен!\r\nhtml {\r\n\t&.loaded {\r\n\t\t.payment__body{\r\n\t\t\ttransform:  scale(1);\r\n\t\t\ttransition: all 1s;\r\n\t\t}\r\n\t\t.payment__image {\r\n\t\t\ttransform: translateX(0);\r\n\t\t\ttransition: all 1s 1.5s;\r\n\t\t}\r\n\t\t.header__body {\r\n\t\t\ttransform: translateY(0);\r\n\t\t\ttransition: transform 1s linear .5s;\r\n\t\t}\r\n\t}\r\n}\r\nbody {\r\n\t// свиток заблокирован\r\n\t.lock & {\r\n\t\toverflow: hidden;\r\n\t\ttouch-action: none;\r\n\t\toverscroll-behavior: none;\r\n\t}\r\n}\r\n.wrapper {\r\n\tbackground: linear-gradient(80.5deg, #83A4BD 11.55%, #A5A2B3 24.51%, #BA929B 33.33%, #BD8689 39.89%, #C46F6A 47.85%, #C65857 55.62%, #BF4145 65.14%, #9C2E37 75.49%, #7A262E 84.66%, #5B1E23 95.55%, #421F23 103.99%, #2D1C22 111.11%);\r\n\tmin-height: 100%;\r\n\tdisplay: flex;\r\n\tflex-direction: column;\r\n\toverflow: hidden;\r\n\t@supports (overflow: clip) {\r\n\t\toverflow: clip;\r\n\t}\r\n\t// Мы нажимаем нижний колонтитул\r\n\t> main {\r\n\t\tflex: 1 1 auto;\r\n\t}\r\n\t// Исправлена ​​ползунки\r\n\t> * {\r\n\t\tmin-width: 0;\r\n\t}\r\n}\r\n//  контейнер ================================================================================================================================================================================================================